     , (10979, 13 /* QuestFailure_EmoteCategory */, 11, 0, 18 /* DirectBroadcast_EmoteType */, 0, 1, NULL, 'Aun Hareltah looks at the egg distastefully.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 11, 1, 10 /* Tell_EmoteType */, 1, 1, NULL, 'This is a very dangerous thing to have in one''s possession. I will dispose of it for you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 0, 17 /* LocalBroadcast_EmoteType */, 0, 0, NULL, '%s, bloodied and battered after the battle in the Royal Hive, presents the stern Aun Hareltah with the head of the Olthoi Queen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 1, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, 'The Tah of Aun holds the head of the Queen before him, and bows in respect to the might of Wharu.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
