     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 4, 17 /* LocalBroadcast_EmoteType */, 1, 0, NULL, '"Great anima of decay," he intones solemnly, "bear no ill will towards %s, who slew your servant respectfully."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 5, 5 /* Motion_EmoteType */, 3, 1, 1090519043 /* Motion_Ready */, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 6, 17 /* LocalBroadcast_EmoteType */, 0, 0, NULL, '"From this point forward, %s shall be known and honored among all Aun as Queenslayer."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 7, 3 /* Give_EmoteType */, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 23200 /* Queenslayer Title Token */, 1, 0, 0, False, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 8, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, '"Further," Hareltah says with a smile, "%s shall be known as my adopted kin!"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 9, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, 'He pulls the startled %s into a warm embrace, as the Aun whisper among themselves. "...not of Tonk!" Aun Dreganaua is heard to protest.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 10, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, '"You have saved this xuta," Hareltah says gravely, his powerful voice carrying over the susurrations of the crowd. "For this, for all your experiences on the path to defeating the Queen, the hardest road known in these strange lands, I recognize you."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
