     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 12, 22 /* StampQuest_EmoteType */, 0, 1, NULL, 'MaraeFinalReward', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 13, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, '%s''s party has been granted forty million experience points!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 14, 17 /* LocalBroadcast_EmoteType */, 3, 0, NULL, '"Finally," Hareltah says, "there is the matter of this totem in my hands. I will prepare it for you with my own hands, my kin, that you may hang from your wall. With its power, your house shall be mighty among Tonk and Isparian, and none shall wash the earth from under it."', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 15, 3 /* Give_EmoteType */, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 11149 /* Head of the Olthoi Queen */, 1, 0, 0, False, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 12, 16, 17 /* LocalBroadcast_EmoteType */, 2, 0, NULL, 'Aun Hareltah embraces %s again with tears in his eyes, and returns the head of the queen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 13, 0, 18 /* DirectBroadcast_EmoteType */, 0, 1, NULL, '"Hrm... so you claim to have slain the spawn of Wharu?"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (10979, 13 /* QuestFailure_EmoteCategory */, 13, 1, 18 /* DirectBroadcast_EmoteType */, 2, 1, NULL, 'Aun Hareltah lays his hand lightly on the Queen''s head, and closes his eyes. After a brief moment, he shakes his head and gently pushes it back towards you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
